import React from 'react';

export default function Movie(props) {
    const renderStars = () => {
        const stars = [];
        for (let i = 0; i < props.item.rating; i++) {
            stars.push(<img key={i} src="star.png" alt="Star" />);
        }
        return stars;
    };

    return (
        <li className="movie-group-item">
            <div><h2>Tillagda filmer:</h2></div>
            <div>{props.item.title}{renderStars()} <button className="btn btn-sm btn-danger float-end" onClick={() => props.deleteMovie(props.item.id)}>Delete</button></div>
        </li>
    );
}
